import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import Home from '../home/Home';
class RouterURL extends Component {
    render() {
        return (
            <Router>
                <div>
                    <Route path="/">
                        <Home />
                    </Route>
                </div>
            </Router>
            
        );
    }
}

export default RouterURL;
